Dana De Armond, Alexa Nicole, Jada Stevens, Jayden Cole, Melissa Jacobs, Madison Ivy, Otto Bauer, Alec Knight, Mark Wood.

Night. Hollywood Boulevard. Bright lights, traffic, girls walking along the famous star-studded strip in thigh high boots and short skirts.

In a cheap apartment above the street, Vivian gets dressed for the night. Meanwhile a wealthy businessman from out of town, is lost on his way to Beverly Hills.

A wrong turn takes him into Hollywood, where he meets Vivian and roommate Laura, on the street. He agrees to pay Vivian if she will show him the way to his hotel.

An intriguing conversation develops between them in the car. By the time they reach his luxurious suite, they are both interested in getting to know one another a little more.
